                pauseContainer_in.appendTo(pauseContainer);

                pauseIcon = $('<span class="sliderPause" aria-label="Start/Stopp"><span class="sliderPause_icon"></span></span>');
                if (options.autostart) pauseIcon.addClass('pause');
