(function ($) {
    $.fn.fontSize = function (options) {

        var defaults = {
            'standard': '#config-font-r a',
            'smaller': '#config-font-s a',
            'bigger': '#config-font-b a',
            'set': 'a.config-font-set', //class="config-font-set setfontsize2"
            'max': 2,
            'min': -2,
            'url': '/ajax/portalstyle.html?fontsize='
        }

        var obj;
        var options = $.extend(defaults, options);
        var size = 0;

        function change(newsize) {
            if (newsize >= options.min && newsize <= options.max) {

                obj.removeClass('fontsize' + size);
                obj.addClass('fontsize' + newsize);
                size = newsize;

                $.get(options.url + size);

            }
        }

        return this.each(function () {

            obj = $(this);

            if (obj.attr('class')) {
                var match = obj.attr('class').match(/fontsize(-?\d+)/);
                if (match && match[1]) {
                    size = parseInt(match[1]);
                }
            }

            $(options.standard).click(function () {
                change(0);
                size = 0;
            });

            $(options.smaller).click(function () {
                var newsize = size - 1;
                change(newsize);
            });

            $(options.bigger).click(function () {
                var newsize = size + 1;
                change(newsize);
            });

            $(options.set).click(function () {
                var match = $(this).attr('class').match(/setfontsize(-?\d+)/);
                if (match) {
                    var newsize = parseInt(match[1]);
                    change(newsize);
                }
            });

        });

    };
})(jQuery);
(function ($) {
    $.fn.contrast = function (options) {

        var defaults = {
            'button': '#config-contrast a',
            'toggleClass': 'contrast',
            'url': '/ajax/portalstyle.html?contrast='
        }

        var obj;
        var options = $.extend(defaults, options);
        var contrast = 0;

        return this.each(function () {

            obj = $(this);

            $(options.button).click(function () {

                obj.toggleClass(options.toggleClass);

                if (obj.hasClass(options.toggleClass)) {
                    var param = 1;
                }
                else {
                    var param = 0;
                }

                $.get(options.url + param);

            });

        });

    };
})(jQuery);
